function traverse(obj, func) {
    for (var i in obj) {
        func.apply(this, [i, obj[i]]);
        if (obj[i] !== null && typeof (obj[i]) == "object") {
            //going one step down in the object tree!!
            traverse(obj[i], func);
        }
    }
}

